Short Description:
Designed for Momo manufacturers, hotels, restaurants etc. This is high quality dough sheet cutter forms and cuts the dough sheet into small round shape strips / sheets of required sizes and thickness. The size of strips depends upon the size of mould fixed in the cutter. It saves a lot of time and Labour cost in the production process.



